import React from 'react';
import { makeStyles } from '@material-ui/styles';
import Grid from '@material-ui/core/Grid';
import Box from '@material-ui/core/Box';
import Typography from '@material-ui/core/Typography';
import {Link} from 'react-router-dom';



const useStyles = makeStyles(theme => ({
  root: {
    display: "flex",
    flexDirection: "column",
    height: "100vh"
  },
  bar: {
    backgroundColor: "#333",
    height: "100%",
  },
  text: {
    color: "white",
    fontFamily: "Lato",
    fontSize: "0.8em",
    margin: 0
  },
  tabContainer: {
    margin: 0
  },
}))

export default function Footer(props) {
  const classes = useStyles();

  return (
    <Box>
      <Grid container spacing = {2} alignItems="stretch" justifyContent="center" direction="row" className={classes.bar}>
        <Grid item xs={6} style={{textAlign: "right", marginTop: "0.5em"}}>
          <Typography className={classes.text} component="p" >Â© Copyright - AC Engineering, Inc. All Rights Reserved | Developed by Edward Briscoe</Typography>
        </Grid>
        <Grid item xs={6} style={{textAlign: "left", marginTop: "0.5em", marginBottom: "0.5em"}}>
          <Typography className={classes.text} component={Link} to="/" style={{ textDecoration: 'none' }}>Home | </Typography>
          <Typography className={classes.text} component={Link} to="/about" style={{ textDecoration: 'none' }}>About Us | </Typography>
          <Typography className={classes.text} component={Link} to="/services" style={{ textDecoration: 'none' }}>Services | </Typography>
          <Typography className={classes.text} component={Link} to="/mobiledatacenters" style={{ textDecoration: 'none' }}>Mobile Data Centers | </Typography>
          <Typography className={classes.text} component={Link} to="/contact" style={{ textDecoration: 'none' }}>Contact Us</Typography>
        </Grid>
        <Box sx={{ display: 'flex' }}  className={classes.bar}></Box>
      </Grid>
    </Box>

  )
}
